var goals = 0;
document.getElementById('JSE-captcha-game-container').style.background = '#A8EAFF';
document.getElementById('JSE-captcha-game').style.cursor = "url('data:image/png;base64,'), auto";
var pitch = new Image();
pitch.src = 'data:image/png;base64,';
pitch.style.position = 'absolute';
pitch.id = Math.floor(Math.random() * 1000000000000);
pitch.onclick = function(e) {
  self.mlData.mouseClicks += 1;
  var rect = e.currentTarget.getBoundingClientRect();
  if (e.pageX == null) {
    eDoc = (e.target && e.target.ownerDocument) || document;
    doc = eDoc.documentElement;
    body = eDoc.body;
    e.pageX = Math.floor((e.touches && e.touches[0].clientX || e.clientX || 0) +
      (doc && doc.scrollLeft || body && body.scrollLeft || 0) -
      (doc && doc.clientLeft || body && body.clientLeft || 0));
    e.pageY = Math.floor((e.touches && e.touches[0].clientY || e.clientY || 0) +
      (doc && doc.scrollTop || body && body.scrollTop || 0) -
      (doc && doc.clientTop || body && body.clientTop || 0));
  }
  var mouseX = e.pageX - rect.left;
  var mouseY = e.pageY - rect.top;
  shoot(mouseX, mouseY);
  if (mouseY < 120) goals += 1;
  console.log(mouseY)
  if (goals >= 3) { 
    self.gameCompleted();
    clearInterval(update);
  }
}

var keeper = new Image();
keeper.src = 'data:image/png;base64,';
keeper.style.position = 'absolute';
keeper.xAxis = 80;
keeper.yAxis = 20;

var ball = new Image();
ball.src = 'data:image/png;base64,';
ball.style.position = 'absolute';
ball.xAxis = 120;
ball.yAxis = 140;
ball.width = 45;

var handleMovement = function(e) {
  var rect = e.currentTarget.getBoundingClientRect();
  if (e.pageX == null) {
    eDoc = (e.target && e.target.ownerDocument) || document;
    doc = eDoc.documentElement;
    body = eDoc.body;
    e.pageX = Math.floor((e.touches && e.touches[0].clientX || e.clientX || 0) +
      (doc && doc.scrollLeft || body && body.scrollLeft || 0) -
      (doc && doc.clientLeft || body && body.clientLeft || 0));
    e.pageY = Math.floor((e.touches && e.touches[0].clientY || e.clientY || 0) +
      (doc && doc.scrollTop || body && body.scrollTop || 0) -
      (doc && doc.clientTop || body && body.clientTop || 0));
  }
  var mouseX = e.pageX - rect.left;
  var mouseY = e.pageY - rect.top;

  if (mouseX < 145) {
    keeper.xAxis = Math.max(keeper.xAxis - 1, 0);
  } else if (mouseX > 145) {
    keeper.xAxis = Math.min(keeper.xAxis + 1, 170);
  }
  self.mlData.mouseEvents += 1;
  if (mouseY < self.mlData.mouseY) self.mlData.mouseDown += 1;
  if (mouseY > self.mlData.mouseY) self.mlData.mouseUp += 1;
  if (mouseX > self.mlData.mouseX) self.mlData.mouseRight += 1;
  if (mouseX < self.mlData.mouseX) self.mlData.mouseLeft += 1;
  self.mlData.mouseX = mouseX;
  self.mlData.mouseY = mouseY;
  self.mlData.mousePattern.push(parseInt(mouseX)+'x'+parseInt(mouseY));
}
document.getElementById('JSE-captcha-game').onmousemove = handleMovement;
document.getElementById('JSE-captcha-game').ontouchmove = handleMovement;

function rotateThis(elem,degrees) {
  elem.style.webkitTransform = 'rotate('+degrees+'deg)'; 
  elem.style.mozTransform    = 'rotate('+degrees+'deg)'; 
  elem.style.msTransform     = 'rotate('+degrees+'deg)'; 
  elem.style.oTransform      = 'rotate('+degrees+'deg)'; 
  elem.style.transform       = 'rotate('+degrees+'deg)'; 
}

function shoot(toX,toY) {
  if (ball.xAxis < toX + 5 && ball.xAxis > toX -5 && ball.yAxis < toY + 5 && ball.yAxis > toY -5) {
    ball.xAxis = 120;
    ball.yAxis = 140;
    ball.width = 45;
  } else {
    if (ball.xAxis > toX + 40) {
      ball.xAxis -= 10;
    } else if (ball.xAxis < toX - 40) {
      ball.xAxis += 10;    
    }
    if (ball.yAxis > toY + 40) {
      ball.yAxis -= 5;
    } else if (ball.yAxis < toY - 40) {
      ball.yAxis += 5;    
    }
    if (ball.xAxis > toX) {
      ball.xAxis -= 10;
    } else if (ball.xAxis < toX) {
      ball.xAxis += 10;    
    }
    if (ball.yAxis > toY) {
      ball.yAxis -= 5;
    } else if (ball.yAxis < toY) {
      ball.yAxis += 5;    
    }
    if (ball.width > 20) ball.width -= 2;
    setTimeout(function() { shoot(toX,toY); }, 50);
  }
}

